import React, { Component } from 'react';
import './App.css';

import Beer from "./Components/Beer";
import Home from "./Components/Home";
import Navbar from "./Components/Navbar";

import Routes from "./Routes/Routes";


class App extends Component {
  render() {

  return (
    <div className="App">

      <Navbar />
      <Routes />
      <Home />
    </div>
  );
}
}

export default App;
